import Card, { PinkCard, TopBar, BottomBar } from "./Components.js";
import "./App.css";
import React from "react";

function ResourcesCyberSecurityAndPrivacy() {
  return (
    <>
      <TopBar />
      <div className="background-color-verylightorange page-intro-styling">
        <div>
          <h1 className="page-title-styling" style={{ color: "darkorange" }}>Cybersecurity &<br /> Privacy</h1>
          <p>Cybersecurity and privacy are significant issues that can impact a person's daily life. Lebanese authorities, such as Telecommunications Regulatory Authority, the Internal Security Forces, and the Lebanese General Security, address relevant issues and advise citizens to be vigilant in the digital world.</p>
        </div>
        <img className="image-styling" src="Desktop-Lock--Streamline-Flex-Neon.png" alt="security" width="500" height="333" />
      </div>

      <div className="resources-part-styling">
        <h1>Resources</h1>
        <div className="five-card-grid-display-styling">
          {["Account Protection", "Device Protection", "Digital Privacy", "Blackmail", "Cyberattacks"].map((title, i) => (
            <Card key={i} title={title} content="Protect your online accounts and devices." backgroundColor="#eec043" />
          ))}
        </div>

        <div className="resources-part-styling" style={{ justifyContent: "center", padding: "20px 0 60px" }}>
          <h1>Resources</h1>
          <div className="pinkcard-row-styling">
            {[
              { title: "Setting up 2-Factor Authentication", content: "Keep your account safe with an extra security step." },
              { title: "Creating a Password", content: "Learn how to create a strong, safe password." },
              { title: "Phishing", content: "A popular type of cyberattack is phishing. Learn how to protect yourself." }
            ].map((item, i) => (
              <PinkCard key={i} title={item.title} content={item.content} />
            ))}
          </div>
        </div>
      </div>
      <BottomBar />
    </>
  );
}

export default ResourcesCyberSecurityAndPrivacy;
